window.bookSummaryJSON = "<p><b>Rebel warrior Roselle St. Sismode returns in the second book of the epic Secondborn series by </b><b><i>USA Today</i></b><b> bestselling author Amy A. Bartol.</b> </p> <p>In the Fates Republic... </p> <p>Firstborns reign supreme. </p> <p>Secondborns kneel in servitude. </p> <p>Thirdborns face death. </p> <p>And Census shadows them all. </p> <p>Secondborn Roselle St. Sismode was pressed into military service to battle the rebel uprising threatening the society that enslaves her. Now, powerful factions conspire to subvert the lines of succession, positioning Roselle to replace her mother as leader of the Republic's armed forces. But the woman who bore her would sooner see Roselle dead than let her usurp her firstborn brother's command. </p> <p>The deadly war of intrigue between her new masters and her ruthless family is but one conflict challenging Roselle. A soldier for the rebellion has drawn her into a rogue army's plot to overthrow the Republic and shatter its brutal caste system. Targeted by assassins and torn between allies, Roselle will have her loyalty, love, and honor tested in the greatest battle of - and for - her life. </p>"; 
